  true,\n\t\"url\": null,\n\t\"notes\": \"The Federal Motor Carrier Safety Administration's
  (FMCSA) Safety Management System (SMS) is an automated data system used by FMCSA
  to monitor motor carrier on-road safety performance. FMCSA analyzes safety performance
  by grouping carrier data in the SMS into seven Behavioral Analysis and Safety Improvement
  Categories (BASICs) which are, in turn, used to identify potential safety  problems
  with individual carriers and determine when an enforcement intervention might be
